import React from "react"
import Menu from '@mui/material/Menu';
import MenuItem from '@mui/material/MenuItem';
import NotificationsActiveSharpIcon from '@mui/icons-material/NotificationsActiveSharp';
import ArrowDropDownIcon from '@mui/icons-material/ArrowDropDown';



const options = [
    'None',
    'Atria',
    'Callisto',
    'Dione',
    'Ganymede',
    'Hangouts Call',
    'Luna',
    'Oberon',
    'Phobos',
    'Pyxis',
    'Sedna',
    'Titania',
    'Triton',
    'Umbriel',
];


const ITEM_HEIGHT = 48;

const Header = () => {
    const [anchorEl, setAnchorEl] = React.useState(null);
  const open = Boolean(anchorEl);
  const handleClick = (event) => {
    setAnchorEl(event.currentTarget);
  };
  const handleClose = () => {
    setAnchorEl(null);
  };
    return (
        <div className="header_wrap">
            <div className="header_name">
                <p>System Settings</p>
            </div>
                <div className="header_user">
                <NotificationsActiveSharpIcon className="svg_icons"/>
                <span style={{display:'flex', justifyContent:'space-around', alignItems:'center', padding:'0px 1px 0px 10px', width: 245}}>
                    <div className="userImage">

                    </div>
                    <p>Seyi Martinz</p>
                    <span style={{marginTop: 8, marginLeft: 7}}>
          < ArrowDropDownIcon onClick={handleClick} styl/>
          <Menu
        id="long-menu"
        MenuListProps={{
          'aria-labelledby': 'long-button',
        }}
        anchorEl={anchorEl}
        open={open}
        onClose={handleClose}
        PaperProps={{
          style: {
            maxHeight: ITEM_HEIGHT * 4.5,
            width: '20ch',
          },
        }}
      >
        {options.map((option) => (
          <MenuItem key={option} selected={option === 'Pyxis'} onClick={handleClose}>
            {option}
          </MenuItem>
        ))}
      </Menu>
        </span>
                </span>
        </div>
        </div>
    )
}


export default Header
